import React from "react";

export const Faq = () => {
  return (
    <div className="faq-container">
      <h1 className="faq-header">Frequently Asked Questions</h1>
      <ul>
        <li>How Much does it cost to tint my vehicle?</li>
        <li>How Much does it cost to instal PPF on my vehicle?</li>
        <li>Is my vehicle bullet proof now?</li>
        <li>What is the difference between dyed film and ceramic film?</li>
      </ul>
    </div>
  );
};
